export default function Plane({ data, index }) {
    function findAnswer(a) {
        return a[0];
    }
    
    return (
        <>
            <a id="link" href={ data[index].filter(findAnswer)[0][2].link } target="_blank" rel="noreferrer">
                <img id="image" src={ data[index].filter(findAnswer)[0][2].pic } alt="plane.jpg"/>
                { data[index].filter(findAnswer)[0][2].copyright }
            </a>
        </>
    );
}
